import React from "react";

/**Import core component (variable)*/
import DateRangePicker from "../../../core/DateTime/DateRangePicker";

export const DEMO = props => {
  const { 
    type,
    view,
    color,
    fill,
    dis,
    icon,
    rightIcon,
    isLoad,
    dense
  } = props;
  return (
    <DateRangePicker
      type={type}
      view={view}
      color={color}
      fill={fill}
      dis={dis}
      icon={icon}
      rightIcon={rightIcon}
      isLoad={isLoad}
      dense={dense}
    />
  );
};
